import React from 'react';

const PrivacyPolicy = () => {
    return (
        <div style={{ padding: '50px', textAlign: 'center' }}>
            <h1>Privacy Policy</h1>
            <p>Your privacy is important to us. We do not share your personal data with third parties. Your artwork is safely stored and only displayed with your consent.</p>
            <img 
                src="https://via.placeholder.com/600x300" 
                alt="Privacy Policy" 
                style={{ width: '100%', maxWidth: '600px', marginTop: '20px', borderRadius: '10px' }} 
            />
        </div>
    );
};

export default PrivacyPolicy;
